  true,\n\t\"url\": null,\n\t\"notes\": \"The FHFA House Price Index (HPI) is a broad
  measure of the movement of single-family house prices.  The HPI is a weighted, repeat-sales
  index, meaning that it measures average price changes in repeat sales or refinancings
  on the same properties. This information is obtained by reviewing repeat mortgage
  transactions on single-family properties whose mortgages have been purchased or
  securitized by Fannie Mae or Freddie Mac since January 1975.\",\n\t\"license_title\":
